import React from 'react';
import { Button, Col, Row, Input, Statistic, Card } from 'antd';
import { SearchOutlined, InfoCircleOutlined, LikeOutlined, ArrowUpOutlined } from '@ant-design/icons';


const Home = () => {
    const onSearch = (e) => {
        console.log(e);
    }
    return (
        <div style={{ height: '80vh' }}>
            <Row align="middle" style={{ height: '100%', height: '100%', textAlign: 'center' }}>
                <Col md={{ span: 16, offset: 4 }} xs={{ span: 20, offset: 2 }}>
                    <Row gutter={{ md: [20, 20] }}>
                        <Col md={{ span: 6, offset: 3 }} xs={{ span: 18, offset: 3 }} style={{ border: "1px solid #d9d9d9", borderRadius: "5px" }}>
                            <Statistic title="최다 구장 점령 수" value={7} prefix={<LikeOutlined />}></Statistic>
                        </Col>
                        <Col md={{ span: 6, offset: 0 }} xs={{ span: 18, offset: 3 }}>
                            <Statistic title="어제 새로등록된 구장 수" value={7} valueStyle={{ color: "#40a9ff" }} prefix={<ArrowUpOutlined />} suffix="개"></Statistic>
                        </Col>
                        <Col md={{ span: 6, offset: 0 }} xs={{ span: 18, offset: 3 }}>
                            <Statistic title="어제 구장깨기 성공 비율" value={30.45} precision={2} valueStyle={{ color: '#3f8600' }} prefix={<ArrowUpOutlined />} suffix="%"></Statistic>
                        </Col>
                    </Row>
                </Col>
                <Col md={{ span: 14, offset: 5 }} xs={{ span: 18, offset: 3 }}>
                    <Input.Search size="large" placeholder="활동지역을 검색하세요" onSearch={onSearch} enterButton />
                </Col>
                <Col span={24}>
                    <Row gutter={{ md: [20, 20], xs: [10, 10] }}>
                        <Col span={24} >
                            <Button type="primary" icon={<SearchOutlined />} size="large" shape="round">현재위치정보 이용하여 둘러보기</Button>
                        </Col>
                        <Col span={24}>
                            <Button size="large" icon={<InfoCircleOutlined />} shape="round">지도로 구장 찾아보기</Button>
                        </Col>
                    </Row>
                </Col>
            </Row>
        </div>
    );
};

export default Home;
